import React, {Component} from "react"

class Categery extends Component{
    render(){
        const {Categeries} = this.props
        return(
            <div className="m-auto col-8">
                <ul className="list-group list-group-horizontal">
                <li className="list-group-item" name="All Categeries">All Categeries</li>
                {Categeries.map(c=> <li key={c._id} className="list-group-item" onclick={()=>OnCategery(c.name)}>{c.name}</li>)}
                 </ul>
            </div>
        )
    }
}
export default Categery;
